import React from 'react'

const Card = (p) => {
    return (
        <div>
            {/* {
                console.log(p)
            } */}
            {
                p.carDetailsArray.map((n) => (
                    <div style={{border:"5px solid bl"}}>
                        <p>{n.carname}: {n.carcolor}</p>
                    </div>
                ))
            }

        </div>
    )
}

export default Card

